import React from 'react';
import { connect } from 'react-redux';
import { GetCompletedData } from './../../actions/tasks';

class CompletedList extends React.PureComponent {


    render() {
        const  {Cdata} = this.props;
        const length = Cdata.length;
        const CompleteItems = length ? (
            Cdata.map(item => {
                return (
                    <div key={item.id}>
                        <span className="name ">{item.name}</span>
                    </div>
                )
            })
        ) : (
                <p>No Completed Tasks to show</p>
            )
        return (
            <>
                <div className="completedList">
                    <span className="name title">Complete</span>
                    {CompleteItems}
                </div>

            </>

        )

    }
}


const mapStateToProps = state => ({
    Cdata: state.doneItems,
});


const mapDispatchToProps = dispatch => ({
    setCompleteData: Cdata => dispatch(GetCompletedData(Cdata)),
});


export default connect(mapStateToProps, mapDispatchToProps)(CompletedList);
